import Logo from '../img/logo.png';
import {Link} from 'react-router-dom';

const NavBar = () => {
  return (
    <div className='navbar'>
      <div className='container'>
        <div className='logo'>
          <img src={Logo} />
        </div>
        <div className='links'>
          <Link />
        </div>
      </div>
    </div>
  )
}

export default NavBar
